import React from "react";

const AppSection = () => (
  <div className="bg-success text-center">
    <p className="display-6 arial text-black p-2">This project visualizes data collected from Data Edmonton website to analyze the climatic trends over 23 years(2000-2022) such as snow fall , rain and temperature. We have added interactive components into the webpage,which enables the users to choose different year to display the data accordingly.</p>
    <div className="row  p-4">
    </div>
  </div>
);

export default AppSection;
